// Orders.js
import React, { useState } from 'react';

const Orders = ({ onOrderClick }) => {
  const orders = [
    { id: 1, customer: 'Customer A', total: 50.0 },
    { id: 2, customer: 'Customer B', total: 75.5 },
    { id: 3, customer: 'Customer C', total: 30.25 },
  ];

  return (
    <div>
      <h2>Orders</h2>
      <ul>
        {orders.map(order => (
          <li key={order.id}>
            <button onClick={() => onOrderClick(order.id)} className="text-blue-500 hover:underline">
              Order #{order.id} - {order.customer} - Total: ${order.total}
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Orders;
